func (o *TSVFile) SetFileParseErrors(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*ParseError) error {
	query := "update \"parse_errors\" set \"file_id\" = null where \"file_id\" = $1"
	values := []interface{}{o.ID}
	if boil.IsDebug(ctx) {
		writer := boil.DebugWriterFrom(ctx)
		fmt.Fprintln(writer, query)
		fmt.Fprintln(writer, values)
	}
	_, err := exec.ExecContext(ctx, query, values...)
	if err != nil {
		return errors.Wrap(err, "failed to remove relationships before set")
	}

	if o.R != nil {
		for _, rel := range o.R.FileParseErrors {
			queries.SetScanner(&rel.FileID, nil)
			if rel.R == nil {
				continue
			}

			rel.R.File = nil
		}
		o.R.FileParseErrors = nil
	}

	return o.AddFileParseErrors(ctx, exec, insert, related...)
}

// RemoveFileParseErrors relationships from objects passed in.
// Removes related items from R.FileParseErrors (uses pointer comparison, removal does not keep order)
// Sets related.R.File.
func (o *TSVFile) RemoveFileParseErrors(ctx context.Context, exec boil.ContextExecutor, related ...*ParseError) error {
	if len(related) == 0 {
		return nil
	}

	var err error
	for _, rel := range related {
		queries.SetScanner(&rel.FileID, nil)
		if rel.R != nil {
			rel.R.File = nil
		}
		if _, err = rel.Update(ctx, exec, boil.Whitelist("file_id")); err != nil {
			return err
		}
	}
	if o.R == nil {
		return nil
	}

	for _, rel := range related {
		for i, ri := range o.R.FileParseErrors {
			if rel != ri {
				continue
			}

			ln := len(o.R.FileParseErrors)
			if ln > 1 && i < ln-1 {
				o.R.FileParseErrors[i] = o.R.FileParseErrors[ln-1]
			}
			o.R.FileParseErrors = o.R.FileParseErrors[:ln-1]
			break
		}
	}

	return nil
}

// AddFileTSVRecords adds the given related objects to the existing relationships
// of the tsv_file, optionally inserting them as new records.
// Appends related to o.R.FileTSVRecords.
// Sets related.R.File appropriately.
func (o *TSVFile) AddFileTSVRecords(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*TSVRecord) error {
	var err error
	for _, rel := range related {
		if insert {
			rel.FileID = o.ID
			if err = rel.Insert(ctx, exec, boil.Infer()); err != nil {
				return errors.Wrap(err, "failed to insert into foreign table")
			}
		} else {
			updateQuery := fmt.Sprintf(
				"UPDATE \"tsv_records\" SET %s WHERE %s",
				strmangle.SetParamNames("\"", "\"", 1, []string{"file_id"}),
				strmangle.WhereClause("\"", "\"", 2, tsvRecordPrimaryKeyColumns),
			)
			values := []interface{}{o.ID, rel.ID}

			if boil.IsDebug(ctx) {
				writer := boil.DebugWriterFrom(ctx)
				fmt.Fprintln(writer, updateQuery)
				fmt.Fprintln(writer, values)
			}
			if _, err = exec.ExecContext(ctx, updateQuery, values...); err != nil {
				return errors.Wrap(err, "failed to update foreign table")
			}

			rel.FileID = o.ID
		}
	}

	if o.R == nil {
		o.R = &tsvFileR{
			FileTSVRecords: related,
		}
	} else {
		o.R.FileTSVRecords = append(o.R.FileTSVRecords, related...)
	}

	for _, rel := range related {
		if rel.R == nil {
			rel.R = &tsvRecordR{
				File: o,
			}
		} else {
			rel.R.File = o
		}
	}
	return nil
}

